    "SecondFurther" : MessageLookupByLibrary.simpleMessage("Obwohl emotional herausfordernd für Eltern, ist der Prozess sehr einfach und bringt eine Vielzahl von Vorteilen für sowohl Babys als auch Eltern mit sich. Sobald das Baby gelernt hat, sich selbst zu beruhigen und alleine wieder einzuschlafen, schläft es länger, tiefer und ist morgens ausgeruhter. Eltern müssen nicht mehrmals in der Nacht aufwachen, um das Baby wieder in den Schlaf zu wiegen oder zu singen - die \'Selbstberuhigung\' lehrt sie, wie sie selbstständig zurück in den Schlaf finden, wenn sie mitten in der Nacht aufwachen. Die Ferber-Methode kann für einige Eltern sehr schwer sein, und eine starke Entschlossenheit ist erforderlich, um die Vorteile zu erlangen. Vertrauen Sie auf sich selbst und auf Ihre Instinkte - dies wird Ihnen und Ihrem Baby zugutekommen. Wenn Sie erfolgreich mit der Methode sind, werden sowohl Sie als auch Ihr Baby besser schlafen."),
