    "SixthFurther" : MessageLookupByLibrary.simpleMessage("Nach der Schlafenszeit-Routine stellen Sie sicher, dass Sie mit dem Training nur beginnen, wenn das Baby schläfrig, aber wach ist. Stellen Sie sicher, dass das Baby in einer sicheren Umgebung ist und Sie das Weinen des Babys von außerhalb des Zimmers hören können. Wenn Sie einen Baby-Monitor haben, stellen Sie sicher, dass Sie das Baby sehen können. Ein Baby-Monitor ist jedoch nicht unbedingt erforderlich für das Schlaftraining. Jedes Baby ist anders und auf seine eigene Weise besonders. Die meisten brauchen 3-7 Tage, um das Selbstberuhigen zu lernen, während andere länger brauchen. Das Weinen und die Einschlafzeit werden in den folgenden Tagen deutlich schneller abnehmen. Ein dankbarer Elternteil erzählte uns, dass sein Baby am ersten Tag insgesamt 16 Minuten geweint hat, gefolgt von 8 Minuten am nächsten Tag, 6 Minuten am nächsten Tag und am vierten Tag in 3 Minuten eingeschlafen ist."),
    "SixthLabel" : MessageLookupByLibrary.simpleMessage("Dinge, die Sie vor dem Start beachten sollten"),
    "SixthMain" : MessageLookupByLibrary.simpleMessage("Menschen sind Gewohnheitstiere. Babys umso mehr. Starten Sie einige Tage vor Beginn der Ferber-Methode eine Schlafenszeit-Routine, damit das Baby die Hinweise zum Schlafen erkennt. Obwohl es keine festen Regeln gibt, versuchen Sie herauszufinden, was für Ihre Familie funktioniert. Einige bevorzugen eine Badezeit-Routine, während andere spazieren gehen; jedoch bleibt das Vorlesen eines Bilderbuchs der Goldstandard (immer dasselbe jeden Abend!). Selbstberuhigung ist der Schlüssel zur Ferber-Methode. Stellen Sie eine Auswahl von Requisiten bereit, aus denen das Baby wählen kann. Zum Beispiel eine weiche Decke, ein Bettlaken, ein reisefreundliches Spielzeug. Am beliebtesten ist jedoch eine Decke, einfach zu tragen und für Übernachtungen mit der Familie geeignet."),
